function renderProgress(a){if(a=Math.floor(a),25>a){var t=-90+a/100*360;$(".animate-0-25-b").css("transform","rotate("+t+"deg)")}else if(a>=25&&50>a){var t=-90+(a-25)/100*360;$(".animate-0-25-b").css("transform","rotate(0deg)"),$(".animate-25-50-b").css("transform","rotate("+t+"deg)")}else if(a>=50&&75>a){var t=-90+(a-50)/100*360;$(".animate-25-50-b, .animate-0-25-b").css("transform","rotate(0deg)"),$(".animate-50-75-b").css("transform","rotate("+t+"deg)")}else if(a>=75&&100>=a){var t=-90+(a-75)/100*360;$(".animate-50-75-b, .animate-25-50-b, .animate-0-25-b").css("transform","rotate(0deg)"),$(".animate-75-100-b").css("transform","rotate("+t+"deg)")}$(".text").html(a+"%")}function randomString(a){for(var t="",r="abcdefghijklmnopqrstuvwxyz0123456789",e=0;a-1>e;e++)t+=r.charAt(Math.floor(Math.random()*r.length));return t}function getRandomInt(a,t){return Math.floor(Math.random()*(t-a+1))+a}